import React from "react";
import { BrowserRouter as Router, Redirect, Route } from 'react-router-dom';

import LoginComponent from '../pages/login';
import { PrivateRoute } from '../_component/PrivateRoute'

import { pathList } from './Paths';

import { Headers } from '../ui_modules/Header';
import { SideBarComponent } from '../ui_modules/Sidebar';

export const AppRoute = () => {
  return (
    <Router>
      <Headers></Headers>
      <SideBarComponent></SideBarComponent>
      {
        pathList.map((compList, id) => {
          return <PrivateRoute path={compList.path} component={compList.component} exact />
        })
      }
      <Route path="/login" exact component={LoginComponent} />
      <Redirect from="*" to="/" />
    </Router>
  );
};
